import { Link } from "react-router-dom";
import { Toolbar, AppBar, Typography, CssBaseline } from "@material-ui/core";
import Pomodoro from "../assets/pomodoro.png";
import styled from "styled-components";

function Navigation() {
  return (
    <div>
      <CssBaseline/>
      <AppBar position="relative">
        <Toolbar>
          <img src={Pomodoro} width="40" />
          <Typography variant="h6" style={{'margin-left': 10,color: "red"}}>
            Tomato Pomodoro
          </Typography>
          <div style={{'margin-left': 300}}>
          <StyledLink to="/">Home</StyledLink>
          <StyledLink to="/admin">Admin</StyledLink>
          <StyledLink to="/user">User</StyledLink>
          </div>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Navigation;
